import React from "react";
import './projects.css';
import { Card } from "react-bootstrap";

function Projects() {
    return(
        <div>
        <Card>
        <Card.Img variant="top" src="https://images.pexels.com/photos/3616760/pexels-photo-3616760.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" />
        <Card.Body>
          <Card.Text>
            Some quick example text to build on the card title and make up the bulk
            of the card's content.
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
    )
}

export default Projects;
